import { GoMarkGithub } from "react-icons/go";
import { FaLinkedin } from "react-icons/fa";
import { IoIosMail } from "react-icons/io";
export default function Contact() {
  return (
    <div className="contact">
      <div className="contact-wrapper">
        <form action="" method="POST" className="form">
          <input
            className="input"
            type="text"
            name="email"
            placeholder="Email"
          ></input>
          <span className="space"></span>
          <input
            className="input"
            type="text"
            name="Name"
            placeholder="Name"
          ></input>
          <span className="space"></span>
          <textarea
            className="input"
            type="text"
            name="Massege"
            rows="4"
            cols="23"
            placeholder="Message"
          ></textarea>
          <span className="space"></span>
          <button type="submit" className="btn">
            Send
          </button>
        </form>
        <div className="contactnaam">
          <p>
            Name:
            <i> Welid Labidi</i>
          </p>
          <p>
            Email:
            <a href="mailto:welidlabidi@gmail.com">Welidlabidi@gmail.com</a>
          </p>
        </div>
        <div className="icons">
          <a href="https://github.com/welidlabidi" className="github-icon">
            <GoMarkGithub />
          </a>
          <span className="space-icon"></span>
          <a
            href="https://www.linkedin.com/in/welid-labidi-086041187/"
            className="linkedin-icon"
          >
            <FaLinkedin />
          </a>
          <span className="space-icon"></span>
          <a href="mailto:welidlabidi@gmail.com" className="mail-icon">
            <IoIosMail />
          </a>
        </div>
      </div>
      <style jsx>{`
        a,
        a:link {
          text-decoration: none;
          color: black;
        }

        .contact-wrapper {
          width: 800px;
          height: 400px;
          position: absolute;
          background-color: rgb(145, 139, 139);
          transform: translate(230%, -80%);
          opacity: 0.5;
          border-radius: 50px;
          /* display: none; */
        }
        .form {
          position: relative;
          width: 40%;
          margin-left: 20px;
          margin-top: 100px;
          display: flex;
          flex-direction: column;
        }
        .btn {
          border-radius: 5px;
          border: none;
        }
        .input {
          border: none;
          border-radius: 5px;
          background: rgb(199, 196, 196);
        }
        .contactnaam {
          position: fixed;
          transform: translate(190%, -195%);
          color: white;
          z-index: 1000;
          width: auto;
          font-size: 20px;
          font-style: italic;
        }
        .contactnaam i {
          color: black;
        }
        .space {
          padding: 10px;
        }
        .space-icon {
          padding: 20px;
        }
        .icons {
          position: fixed;
          transform: translate(270%, -140%);
          font-size: 35px;
        }
        .github-icon {
          color: lightgreen;
        }
        .linkedin-icon {
          color: skyblue;
        }
      `}</style>
    </div>
  );
}
